import { useState } from "react";

function obtenerLideresEquipo(){

    const [lideresEquipo, setLideresEquipo] = useState(null);
    fetch("/supervisor")
      .then((res) => res.json())
      .then((lideresEquipo) => console.log(lideresEquipo));
      
      return lideresEquipo;
  }

export default obtenerLideresEquipo;
